import React from 'react'

import {
    SidbarContainer,
    ClsIcon,
    CloseIcon
} from './SidebarElements'

const DropdoqnSidebar = () => {
    return (
        <SidbarContainer>
            <ClsIcon>
                <CloseIcon/>
            </ClsIcon>
        </SidbarContainer>
    )
}

export default DropdoqnSidebar;
